import React from 'react'
import './Form.css'

const Form = () => {
    return(
        <>
            <div className='main_div'>
                <h1>Hello</h1>
                <input type="text" placeholder='Enter Your Name' /><br/>
                <button>Submit Me</button>
            </div>
        </>
    );
}

export default Form;
